import React from "react";
import PageTitle from "../PageTitle";
import './Login.css';


function Login() {
  return (
    <div className="">
      <PageTitle title="Login or Sign Up" />
      <div className="login_box">
        <h6>Username:</h6>
        <hr />
        <h6>Password:</h6>
      </div>

    </div>
  );
}

export default Login;
